query:
/*+ NoHashJoin(mk t mc) */ select count(*)
from movie_keyword AS mk
inner join title AS t
on t.id = mk.movie_id AND mk.keyword_id > 31924 AND t.kind_id < 7 AND t.production_year < 2006
inner join movie_companies AS mc
on t.id = mc.movie_id AND mc.company_id < 11138 AND mc.company_type_id > 1;
